function CompararValores(o){var e=document.getElementById("Atributos_"+o+"__Valor"),l=document.getElementById("Atributos_"+o+"__ValorEnTrama"),a=e.value,t=l.value;l.style.backgroundColor=a==t?e.style.backgroundColor:"yellow"}function IgualarValores(o){var e=document.getElementById("Atributos_"+o+"__Valor"),l=document.getElementById("Atributos_"+o+"__ValorEnTrama"),a=e.value,t=l.value;a!=t&&(l.value=e.value,l.style.backgroundColor=e.style.backgroundColor)}